import AccordionWrapper from './ProjectWrapper'; 
import AccordionItem from './ProjectItem';
import './Projects.css';

const Projects = () => {
  const data = [
    {
      "title": "Final Year Project",
      "description": "<p><strong>Insert Github link</strong></p>"
    },
    {
      "title": "Object Oriented Programming",
      "description": "<p><strong>Insert Github link</strong></p>"
    },
    {
      "title": "Software Project Management",
      "description": "<p><strong>Insert Github link</strong></p>"
    },
    {
      "title": "Enterprise Solution Development",
      "description": "<p><strong>Insert Github link</strong></p>"
    },
    {
      "title": "Web Application Development 2",
      "description": "<p><strong>Insert Github link</strong></p>"
    },
    {
      "title": "Web Application Development 1",
      "description": "<p><strong>Insert Github link</strong></p>"
    }
    ,
    {
      "title": "Interactive Design Prototype",
      "description": "<p><strong>Insert Github link</strong></p>"
    }
  ];


  return (
    <div className="App">
      <div className="content">
        <div className="app-description">
          <h1>Projects</h1>

        </div>
          <AccordionWrapper>
            {data.map((item, index) => (
              <AccordionItem key={index} index={index} title={item.title} description={item.description} />
            ))}
          </AccordionWrapper>
      </div>
    </div>
  );
}

export default Projects;
